import React from "react";
import {
  Heading,
  HiddenHeading,
  SubHeading,
} from "../components/styledComponents/index.jsx";

const App = () => {
  return (
    <>
      <Heading>Find something interesting? </Heading>
      <HiddenHeading> Contact </HiddenHeading>
      <SubHeading>Let's chat</SubHeading>
    </>
  );
};

export default App;
